import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Users,
  ShoppingCart,
  Package,
  TrendingUp,
  ArrowUp,
  ArrowDown,
  MoreVertical,
  Layers,
  Search
} from "react-feather";
import "./Dashboard.css";

const API = "https://grocerrybackend.onrender.com/api";

export default function Dashboard() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetching products for the Catalog summary section
  useEffect(() => {
    const loadProducts = async () => {
      try {
        const res = await axios.get(API + "/prices");
        const list = [];
        res.data.data.forEach(c => {
          c.subcategories.forEach(s => {
            s.products.forEach(p => list.push(p));
          });
        });
        setProducts(list.slice(0, 5)); // Show top 5 for dashboard
      } catch (err) { console.error(err); }
    };
    loadProducts();
  }, []);

  return (
    <div className="tm-dashboard-container">
      {/* HEADER SECTION */}
      <div className="tm-dash-header">
        <div>
          <h2 className="tm-dash-title">eCommerce Dashboard</h2>
          <p className="tm-dash-subtitle">Home / Dashboard</p>
        </div>
        <div className="tm-dash-actions">
          <button className="tm-btn-white"><Search size={16} /> Search</button>
          <button className="tm-btn-blue">Jan 07 - Jan 13</button>
        </div>
      </div>

      {/* TOP METRICS CARDS (Screenshot 1 Style) */}
      <div className="tm-metrics-grid">
        <MetricCard
          title="Total Views"
          value="3,456"
          percent="0.43%"
          up={true}
          icon={<Package size={22} />}
        />
        <MetricCard
          title="Total Profit"
          value="$45,231"
          percent="4.35%"
          up={true}
          icon={<ShoppingCart size={22} />}
        />
        <MetricCard
          title="Total Product"
          value="2,450"
          percent="2.59%"
          up={true}
          icon={<Layers size={22} />}
        />
        <MetricCard
          title="Total Users"
          value="3,456"
          percent="0.95%"
          up={false}
          icon={<Users size={22} />}
        />
      </div>

      {/* CHARTS & ANALYTICS AREA (Screenshot 3 Style) */}
      <div className="tm-analytics-row">
        <div className="tm-chart-card main-chart">
          <div className="tm-card-head">
            <h3>Impression & Data Traffic</h3>
            <div className="tm-chart-tabs">
              <span className="active">Day</span>
              <span>Week</span>
              <span>Month</span>
            </div>
          </div>
          <div className="tm-chart-placeholder">
            {/* Imagine the line chart from Screenshot 3 here */}
            <div className="tm-fake-graph"></div>
            <div className="tm-graph-labels">
              <span>Jan</span><span>Feb</span><span>Mar</span><span>Apr</span><span>May</span><span>Jun</span>
            </div>
          </div>
        </div>

        <div className="tm-chart-card side-chart">
          <div className="tm-card-head"><h3>Profit Channels</h3></div>
          <div className="tm-donut-area">
            <div className="tm-donut-hole">
              <h4>65%</h4>
              <span>Overall</span>
            </div>
          </div>
        </div>
      </div>

      {/* CATALOG SUMMARY TABLE (Screenshot 5 Style) */}
      <div className="tm-catalog-card">
        <div className="tm-card-head">
          <h3>Top Selling Products</h3>
          <button className="tm-view-all">View All</button>
        </div>
        <div className="tm-table-wrapper">
          <table className="tm-dash-table">
            <thead>
              <tr>
                <th>Product Name</th>
                <th>Category</th>
                <th>Price</th>
                <th>Status</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {products.map((p, i) => (
                <tr key={i}>
                  <td>
                    <div className="tm-prod-cell">
                      <div className="tm-prod-img">{p.name.charAt(0)}</div>
                      <span>{p.name}</span>
                    </div>
                  </td>
                  <td>Electronics</td>
                  <td className="tm-bold">$2,690</td>
                  <td><span className="tm-badge-green">In Stock</span></td>
                  <td><MoreVertical size={16} color="#64748b" /></td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

/* SUB-COMPONENT: METRIC CARD */
function MetricCard({ title, value, percent, up, icon }) {
  return (
    <div className="tm-metric-card">
      <div className="tm-metric-icon">{icon}</div>
      <div className="tm-metric-info">
        <h3 className="tm-metric-value">{value}</h3>
        <p className="tm-metric-label">{title}</p>
      </div>
      <div className={`tm-metric-badge ${up ? 'up' : 'down'}`}>
        {percent} {up ? <ArrowUp size={12} /> : <ArrowDown size={12} />}
      </div>
    </div>
  );
}
